<!DOCTYPE html>
<html>

<head>
    <meta charset="utf-8">
    <title>Quiz#0</title>

    <script type="text/javascript">

        async function main() {
            text = await dwnldfile('./input.txt');

            document.getElementById("result").innerHTML = 'Result: ';
            for (let el in parsefile(text))
                document.getElementById("result").innerHTML += el + ' ';
        }

        async function dwnldfile(filename) {
            return await (await fetch(filename)).text();
        }

        function parsefile(text) {
            let strings = text.split("\n");
            let n_k_arr = strings[0].split(' ');
            let n = parseInt(Number(n_k_arr[0]));
            let k = parseInt(Number(n_k_arr[1]));
            let arr = {}, res = {};

            strings.splice(0, 1);

            for (let i = 0; i < n; i++)
                arr[strings[i]] = 0;
            for (let i = 0; i < n; i++)
                arr[strings[i]]++;
            for (let i = 0; i < n; i++)
                if (arr[strings[i]] === 1)
                    res[strings[i]] = arr[strings[i]];

            return res;
        }

    </script>
</head>

<body onload="main()">
    <p id="result"></p>
</body>
